  false,\n\t\"url\": null,\n\t\"notes\": \"This is a proposal to construct a multi-agency
  facility to house the High Desert Interagency Partnership.  The facility would be
  on federally owned land in Hines, Oregon where the present offices of the Burns
  and Snow Mountain Ranger districts are located. All agency offices and warehouse
  space would be at this location except for Fish and Wildlife Service. They would
  have only a branch office at this site, and would continue to maintain their headquarters
  office at the Malheur National Wildlife Refuge.  A Board of Directors has been formed
  to oversee the development of this project. The members are the local managers of
  the agencies involved as well as two people from the Forest Service Regional Office.
  A Memorandum of Understanding has been signed by the respective State and Regional
  agency heads.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
